import { makeStyles } from "@material-ui/core/styles";
import { themes } from '../../themes/index';

export default makeStyles(() => ({
    container:{
        backgroundColor: themes.palette.primary.main,
        color: themes.palette.secondary.dark,
    },
    typography:{
        color: themes.palette.secondary.dark,
        marginTop: -5,
        fontWeight: 'lighter',
        padding:0,
    },
    button:{
        backgroundColor: themes.palette.primary.main,
        color: themes.palette.secondary.dark,
        marginTop:-50,
        marginLeft: 10,
        fontWeight: 'lighter',
        padding: 0,
    }
}))
